import React from 'react';
import './App.css';

class App extends React.Component {
  render() {
    const name = 'ben shabi';
    const loading = true;
    const showname = true;
    return (
      <div className="App">
        {loading ? <h3>Loading ...</h3> : <h1> Hello {showname && name}</h1>}
      </div>
    );
  }
}

export default App;
